import React from 'react'
import PropTypes from 'prop-types'
import { withStyles } from '@material-ui/core/styles'
import { Grid, Card, CardHeader, CardContent } from '@material-ui/core'

const styles = theme => ({
	root: {
		justifyContent: 'center',
	},
  cardRoot: {
		[theme.breakpoints.up('sm')]: {
			marginTop: '2rem',
		},
		textAlign: 'center',
  },
	cardHeader: {
		borderBottom: '1px solid #eee',
		background: 'linear-gradient(to right, #154b9c, #13bcd4)',
	},
	cardTitle: {
		fontFamily: 'Raleway',
		fontSize: 20,
		fontWeight: 600,
		color: theme.palette.common.white,
		textAlign: 'center',
	}
})

const PricingTechky = (props) => (
	<Grid container spacing={40} className={props.classes.root}>
		<Grid item sm={2}></Grid>
		<Grid item xs={12} sm={4}>
			<Card className={props.classes.cardRoot}>
				<CardHeader title='Basic' subheader='$9.99 to sign up' className={props.classes.cardHeader}/>
				<CardContent>
					<p>1 free month</p>
					<p>Email support</p>
				</CardContent>
			</Card>
		</Grid> 
		<Grid item xs={12} sm={4}>
			<Card className={props.classes.cardRoot}>
				<CardHeader title='Pro' subheader='$9.99 to sign up' className={props.classes.cardHeader}/>
				<CardContent>
					<p>$4.99/month</p>
					<p>($29.99/year)</p>
					<p>Email support</p>
					<p>Phone support</p>
				</CardContent>
			</Card>
		</Grid>
		<Grid item sm={2}></Grid>
	</Grid>
)

PricingTechky.propTypes = {
  classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(PricingTechky)
